import Vue from 'vue'
import VueRouter from 'vue-router'
import Layout from '../views/Layout.vue'

Vue.use(VueRouter)

const routes = [
  //login route
  {
    path: '/login',
    name: 'Login',
    component: ()=> import('@/views/login/Login.vue')
  },
  {
    path: '/',
    name: 'Layout',
    component: Layout,
    children: [

    ]
  },

]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
